class Solution {
    fun beautifulSubstrings(s: String, k: Int): Long {
        val n = s.length
        var count = 0L
        val vowels = setOf('a', 'e', 'i', 'o', 'u')

        for (i in 0 until n) {
            var vowelCount = 0
            var consonantCount = 0
            for (j in i until n) {
                if (s[j] in vowels) vowelCount++ else consonantCount++
                if (vowelCount == consonantCount && (vowelCount * consonantCount) % k == 0) count++
            }
        }

        return count
    }
}
